import React from 'react';
import styled from 'styled-components';

function ResumeIntroAi() {
	return (
		<ComponentWrapper>
			<div className="Kr_ResumeIntro_content__Y3x_h">
				<div className="Kr_ResumeIntro_ai_content__IyV_A">
					<div>
						이력서 완성하면
						<p>
							<img
								src="https://static.wanted.co.kr/images/userweb/resume_intro/resume_ai_logo.png"
								width="198"
								height="33"
								alt="ai_logo"
							/>
							가 포지션 추천까지
						</p>
					</div>
					<p>
						이력서를 분석하여 딱 맞는 포지션을 찾아드려요.
						<br />
						원티드AI가 추천한 포지션은 서류합격률이 일반 지원 대비
						4배 높습니다.
					</p>
					<button
						type="button"
						className="Button_Button__root__V1ie3 Button_Button__contained__toUI5 undefined Button_Button__sizeMedium__k0A1w"
					>
						<span className="Button_Button__label__1Kk0v">
							원티드 이력서 시작하기
						</span>
					</button>
				</div>
				<img
					src="https://static.wanted.co.kr/images/userweb/resume_intro/resume_ai_sample.png"
					width="516"
					height="352"
					alt="ai_sample"
				/>
			</div>
		</ComponentWrapper>
	);
}

const ComponentWrapper = styled.section`
	padding: 0 !important;
	height: 452px;
	> div {
		position: relative;
		height: 100%;
		display: flex;
		align-items: center;
		text-align: left;
		text-align: center;
		max-width: 1060px;
		margin: 0 auto;
		word-break: keep-all;
		word-wrap: break-word;
	}
`;
export default ResumeIntroAi;
